import React from 'react';

import PlayersList from '../components/PlayersList';
import './Players.css';

const Players = () => {
  const MOCK_PLAYERS = [
    {
      id: 'p1',
      name: 'Novak Djokovic',
      country: 'Serbia',
      age: 33,
      grand_slams: 17,
      ranking: null,
      points: 12030,
    },
    {
      id: 'p2',
      name: 'Rafael Nadal',
      country: 'Spain',
      age: 34,
      grand_slams: 20,
      ranking: null,
      points: 9850,
    },
    {
      id: 'p3',
      name: 'Roger Federer',
      country: 'Switzerland',
      age: 39,
      grand_slams: 20,
      ranking: null,
      points: 6630,
    },
    {
      id: 'p4',
      name: 'Daniil Medvedev',
      country: 'Russia',
      age: 24,
      grand_slams: 0,
      ranking: null,
      points: 8470,
    },
  ];

  MOCK_PLAYERS.sort(function (a, b) {
    return a.points - b.points;
  });

  return <PlayersList items={MOCK_PLAYERS} />;
};

export default Players;
